/*
    Styles for MediaWiki navbox tables.
    These rules are based on the desktop wiki's styling with refinements.
*/

.navbox {
    font-size: 0.85em;
    background: var(--navbox-background);
    border-collapse: collapse;
    /* Margin is now handled by the parent .collapsible-container. */
    margin: 0;
    width: 100%;
    clear: both;
    box-shadow: 0 0.25rem 0.35rem -0.25rem rgba(0, 0, 0, 0.1);
}

/* Remove generic cell borders - use selective borders instead to match web version */
/* Main navbox cells will get borders through specific selectors below */

/* Remove generic subgroup cell borders - use selective borders instead to match web version */
/* Subgroup cells will get borders through specific selectors below */

